import React, { Component } from 'react'

export default class Table extends Component {
    render() {
        return (
            <table>
                <tr>
                {
                    this.props.data.map((val)=><li>{Object.getOwnPropertyNames(val)}</li>)
                }
    </tr>
            </table>
        )
    }
}
